</div></div></div><div class=""panel""><div class=""panel-hdr""><h2 id=""Flavors"">Flavors</h2></div><div class=""panel-container show""><div class=""panel-content"">
<p>The package you downloaded is divided into several projects, or <strong>Flavors</strong>, that should align with your project needs, whether it's a quick start of a few pages or a full-blown management portal, each project has its own unique set of features to help you decide.</p>
<p>And if you can't find the flavor you were looking for? No problem, the projects and theme have been structured in such a way that combining any set of features should be achievable with minimal effort.</p>
<p>With that said, here is the overview of the current flavors that are supported in <strong>SmartAdmin for ASP.NET</strong>.</p>
<ul>
<li>
<p><strong>SmartAdmin for ASP.NET Core 3.1 - Bare</strong> - Want to start from scratch and slowly add to your site structure and pages? Then <strong>Bare</strong> will be your best starting point.</p>
</li>
<li>");
            WriteLiteral(@"
<p><strong>SmartAdmin for ASP.NET Core 3.1 - Slim</strong> - Need a light version with minimal plugins and fast page loading without compromise? No database or authentication support needed? Then <strong>Slim</strong> will be your best starting point.</p>
</li>
<li>
<p><strong>SmartAdmin for ASP.NET Core 3.1 - Seed</strong> - Want to checkout the most popular pages SmartAdmin has to offer, such as Dashboards, Charts, Chat and other cool features? Then <strong>Seed</strong> will allow you to view all the required markup to start planning the features you want to include.</p>
</li>
<li>
<p><strong>SmartAdmin for ASP.NET Core 3.1 - Full</strong> - Planning on building a fully fledged out Management Portal with Dashboards and database driven logic and data combined with other cool features? Then <strong>Full</strong> will ensure that you will have all the necessary examples and plugins to start building your next big project, including a well adopted architecture and trusted design patterns to guide your every s");
            WriteLiteral(@"tep!</p>
</li>
</ul>
<blockquote>
<p><strong>Note:</strong> For a full matrix overview of the features per Flavor please see the <a href=""https://smartadmin-core.azurewebsites.net/aspnetcore/editions"">Editions</a> page, available through the online Preview of the <strong>Full</strong> flavor.</p>
</blockquote>
<h3>ASP.NET Razor Pages and Blazor</h3>
<p>We have also included a complete <strong>Razor Pages</strong> based flavor of the SmartAdmin Theme using the <strong>Full</strong> feature set. Any and all features, such as Filters and Authentication have been thouroughly tested to ensure these remain compatible when switching to the <strong>Razor Pages</strong> flavor.</p>
<blockquote>
<p><strong>Note:</strong> We are currently still evaluating the possibility of adding a <strong>server-side</strong> Blazor flavor to the Project, but we want to make sure this does not compromise the feature set of the Theme, so please stay tuned for future updates!</p>
</blockquote>
</div></div></div><div class=""panel""><div c");
            WriteLiteral(@"lass=""panel-hdr""><h2 id=""Resources"">Resources</h2></div><div class=""panel-container show""><div class=""panel-content"">
