<ol>
<li><a href=""https://dotnet.microsoft.com/learn/aspnet/what-is-aspnet"">ASP.NET Introduction</a></li>
<li><a href=""https://dotnet.microsoft.com/apps/aspnet/mvc"">MVC Introduction</a></li>
<li><a href=""https://docs.microsoft.com/en-us/ef/core/"">EF Core Introduction</a></li>
<li><a href=""https://docs.microsoft.com/en-us/aspnet/core/tutorials/razor-pages/razor-pages-start"">Razor Pages Introduction</a></li>
<li><a href=""https://docs.microsoft.com/en-us/aspnet/core/security/authentication/identity"">ASP.NET Core Identity</a></li>
<li><a href=""https://www.devexpress.com/support/training/blazor/"">Blazor Introduction</a></li>
<li><a href=""https://docs.microsoft.com/en-us/dotnet/csharp/getting-started/"">C# Introducti");
